import React from 'react';
import Item from './Item.js'

const ListItems = ({itemsArr}) => {
    const itemComponent = itemsArr.map((user, i) => {
            return (
                <Item key={i} itemValue={itemsArr[i]}/>
            )
        }          
    )
    return (
        <div>
            {itemComponent}
        </div>
    )
}

export default ListItems;
